import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';

// Dashboard Component
import Dashboard from './Components/Dashboard/Index';

const App = () => {
  return(
    <>
     <Router>
        <Routes>

            {/* Dashboard Route */}
            <Route path='/Dashboard' element={<Dashboard />} />

       </Routes>
      </Router>
    </>
  )
}

export default App;
